      <div className="search-box">
      <input className="search-txt" type="text" name="" placeholder="Chercher des iscrits" />
       <div className="search-btn">
      <img src={process.env.PUBLIC_URL+'/assets/images/search.svg'} width="15px" alt="search Logo" alt="Icones" />
      </div> 
      </div> 
    );
  }
}

export default SearchBar;



